B.Od=new A.d7("Hint on the password",null,"<em>There is a message...</em><br><br>I don't usually write down my passwords on paper.... So I only noted hints, and on several papers hidden all over the house !<br>Here's the first hint<br><br>Aladdin and Aladde rub the lamp. The genie appears and asks them to make a wish. Aladdin asks <q>I want a penny... But it has to double every day for 30 days !</q>. Aladde retorts <q>Hehe, I want 1 million pounds now!</q><br><br><strong>The first digit of the computer password is pronounced in french like the last two letters of the richest person's name after 30 days.</strong>")
